import React from 'react';
import { motion } from 'framer-motion';

const Skills = ({ theme }) => {
  const skills = [
    'HTML', 'CSS', 'JavaScript', 'TypeScript', 'React', 'Node.js', 'Express',
    'Python', 'Django', 'NumPy', 'scikit-learn', 'Java', 'C', 'C++', 'SQL',
    'MongoDB', 'PostgreSQL', 'Mongoose', 'Git', 'GitHub', 'Docker', 'JWT',
    'Cloudinary', 'REST APIs', 'Postman'
  ];

  const getIconPath = (name) => {
    const normalized = name.toLowerCase()
      .replace('+', 'p')
      .replace(/\s+/g, '-')
      .replace(/\./g, '')
      .replace(/#/g, 'sharp');

    switch (name) {
      case 'C++': return '/icons/cpp.svg';
      case 'C': return '/icons/c.svg';
      case 'C#': return '/icons/csharp.svg';
      case 'Node.js': return '/icons/nodejs.svg';
      case 'scikit-learn': return '/icons/scikit-learn.svg';
      case 'REST APIs': return '/icons/rest.svg';
      case 'GitHub': return '/icons/github.svg';
      case 'PostgreSQL': return '/icons/postgresql.svg';
      default: return `/icons/${normalized}.svg`;
    }
  };

  return (
    <section id="skills" className="skills-section">
      <motion.div 
        className="skills-container"
        initial={{ opacity: 0 }}
        whileInView={{ opacity: 1 }}
        transition={{ duration: 0.8, ease: 'easeOut' }}
        viewport={{ once: false, margin: '-100px' }}
      >
        <motion.h2
          className="about-title text-shadows"
          initial={{ opacity: 0, scale: 0.9 }}
          whileInView={{ opacity: 1, scale: 1 }}
          transition={{ duration: 0.6, delay: 0.2, ease: 'easeOut' }}
          viewport={{ once: false }}
        >
          Technical Skills
        </motion.h2>

        <div className="skills-icons-grid">
          {skills.map((name) => (
            <div className="skill-item" key={name}>
              <img
                className="skill-icon"
                src={getIconPath(name)}
                alt={name}
                loading="lazy"
              />
              <span className="skill-label">{name}</span>
            </div>
          ))}
        </div>
      </motion.div>

