          background: ${theme === 'dark' ? 'rgba(227, 229, 230, 0.03)' : 'rgba(0, 0, 0, 0.03)'};
          border: 1px solid ${theme === 'dark' ? 'rgba(227, 229, 230, 0.12)' : 'rgba(0, 0, 0, 0.06)'};
        }
