          width: 48px;
          height: 48px;
          object-fit: contain;
          filter: ${theme === 'dark' ? 'drop-shadow(0 6px 12px rgba(0,0,0,0.45))' : 'drop-shadow(0 4px 8px rgba(0,0,0,0.12))'};
        }
        .skill-label {
          font-family: 'Poppins', sans-serif;
          font-size: 12px;
          font-weight: 600;
          color: ${theme === 'dark' ? '#e3e5e6' : '#111827'};
